INSERT INTO `pt_information_description` (`information_id`, `language_id`, `title`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(2, 1, 'Overview', 'Rotary is a global network of 1.2 million neighbors, friends, leaders, and problem-solvers who come together to make positive, lasting change in communities at home and abroad.Solving real problems takes real commitment and vision. For more than 110 years, Rotary members have used their passion, energy, and intelligence to take action on sustainable projects. From literacy and peace to water and health, we are always working to better our world, and we stay committed to the end.\r\n\r\n<a href=\"https://www.rotary.org/en/about-rotary\" target=\"_blank\" class=\"read-btn\" data-original-title=\"\" title=\"\">Read More</a>', 'Overview', 'Overview', 'Overview                                                                                                '),
(3, 1, 'About Rotary International', 'There are 1.2 million Rotarians in 34,000 clubs doing good all over the world. This network of clubs makes up Rotary International. As a club member you help elect your own leaders each year, and your president works with your president-elect, officers, board members, and committee chairs to manage the club. Your club pays dues to RI, and in return RI provides resources, training, and programs to help your club run effectively. Your club and others in your geographic area are part of a district, led by your district governor. Districts help clubs connect to each other and access Rotary resources.', 'About Rotary International', 'About Rotary International', 'About Rotary International'),
(4, 1, 'About District 3141', 'The Rotary Club of Bombay was formed on 19th March 1929..\r\n\r\nOf the 38 charter members of the club in Bombay, 37 were non-Indians. The only Indian was Sir Phiroz Sethna, a legislative member, who later served as District Governor (1937-\'38).\r\n\r\nAfter Rotary Club of Bombay was chartered, Rotary movement grew in Gujarat, Maharashtra and nearby areas.\r\n\r\nIt also grew in other Indian States as well as in neighboring countries.\r\n\r\nBetween 1929 till 1970, these clubs were structured in various zones &amp; districts several times to accommodate the growth of Rotary movement worldwide.\r\n\r\nThen, RI District 314 came into existence on 1st July 1970 with a membership of 1702 in 34 clubs.\r\n\r\nPreviously, the clubs currently in District 3140 were in the District 890, 920, 540 and 315 according to the dates on which they were admitted to Rotary International.\r\n\r\nAt its February 1982 meeting, the Board of Directors of Rotary International reorganized the Rotary Clubs in India according to the revenue districts.\r\n\r\nDistrict 314 comprised the revenue districts of Akola, Amravati, Bhandara, Bombay, Buldhana, Chandrapur, Jalgaon, Nasik, Thane, Wardha and Yeotmal.\r\n\r\nEffective 1st July 1990, RI District 314 was reorganised to comprise the revenue districts of only Bombay &amp; Thane. There were sixty-three Rotary Clubs in this District.\r\n\r\nThereafter the District 314 was renamed as District 3140\r\n\r\nRotary District 3140 is the largest district in the world with 148 Clubs and 7,500 members. District will be bifurcated in to two districts from 1st July, 2016‚Ä¶ District 3141 (Mumbai Revenue district) and 3142 (Thane Revenue District).', 'About District 3141', 'About District 3141', 'About District 3141                               '),
(5, 1, 'Ri President 2019-20', '<p class=\"digi-p\">\r\n	<img src=\"image/maloney.jpg\" class=\"img-responsive page-img\">\r\n</p>\r\n<p>Mark Daniel Maloney</p>\r\n<p>President 2019-20</p>\r\n<p>Rotary Club of Decatur</p>\r\n<p>Alabama, USA</p>\r\n<p>Mark Daniel Maloney is a principal in the law firm of Blackburn, Maloney, and Schuppert LLC, with a focus on taxation, estate planning, and agricultural law. He represents large farming operations in the Southeastern and Midwestern United States, and has chaired the American Bar Association‚Äôs Committee on Agriculture in the section of taxation. He is a member of the American Bar Association, Alabama State Bar Association, and the Alabama Law Institute.</p>\r\n\r\n<p>He has been active in Decatur‚Äôs religious community, chairing his church‚Äôs finance council and a local Catholic school board. He has also served as president of the Community Foundation of Greater Decatur, chair of Morgan County Meals on Wheels, and director of the United Way of Morgan County and the Decatur-Morgan County Chamber of Commerce.</p>\r\n\r\n<p>A Rotarian since 1980, Maloney has served as an RI director; Foundation trustee and vice chair; and aide to 2003-04 RI President Jonathan Majiyagbe. He also has participated in the Council on Legislation as chair, vice chair, parliamentarian, and trainer. He was an adviser to the 2004 Osaka Convention Committee and chaired the 2014 Sydney Convention Committee.</p>\r\n\r\n<p>Prior to serving as a district governor, Maloney led a Group Study Exchange to Nigeria.</p>\r\n\r\n<p>He also served as Future Vision Committee vice chair; regional Rotary Foundation coordinator; Foundation training institute moderator; Foundation permanent fund national adviser; member of the Peace Centers Committee; and adviser to the Foundation‚Äôs Water, Sanitation, and Hygiene in Schools Target Challenge Committee.</p>\r\n<a href=\"https://www.rotary.org/en/about-rotary/our-leaders/directors\" target=\"_blank\" class=\"read-btn\" data-original-title=\"\" title=\"\">Read More</a>\r\n							', 'Ri President 2019-20', 'Ri President 2019-20', 'Ri President 2019-20                                                                                                                                                            '),
(6, 1, 'Core Team 19-20', '.', 'Core Team 19-20', 'Core Team 19-20', 'Core Team 19-20                                                                                                                                                                                                                                                '),
(7, 1, 'Club In 3141', '', 'Club In 3141', 'Club In 3141', 'Club In 3141                                                    '),
(8, 1, 'Membership', '<p>Impact starts with our members - people like you who want to be part of making the world a better place. At club meetings in communities across the globe, our members come together to strengthen their connections to friends and neighbors and their commitment to improving lives.</p>\r\n\r\n<h3>Who can join?</h3>\r\n\r\n<p>We\'re looking for people who want to give back to their communities.</p>\r\n\r\n<p>Rotary clubs also welcome Rotaractors, Rotary Peace Fellows, and other members of the family of Rotary who qualify for membership.</p>\r\n\r\n<h3>How can I become a member?</h3>\r\n\r\n<p>Clubs accept new members by invitation. To help us find the right club for you, we‚Äôll ask you a few questions about yourself and your interests. Then we‚Äôll share your answers with Rotary leaders in your community who will match you with a club.</p>\r\n<p>Contact US <a href=\"mailto:rtng.mittal@gmail.com\" data-original-title=\"\" title=\"\">&nbsp;&nbsp;rtng.mittal@gmail.com</a></p>\r\n<p><img src=\"template/view/dist/images/Progress-Tracker-Graphic_EN_0.png\" class=\"img-responsive\" style=\"width:100% !important;\"></p>\r\n<a href=\"https://www.rotary.org/en/about-rotary/membership\" target=\"_blank\" class=\"read-btn\" data-original-title=\"\" title=\"\">Read More</a>', 'Membership', 'Membership', 'Membership                                                                                                        '),
(9, 1, 'District Governors', '', 'District Governors', 'District Governors', 'District Governors                                                    '),
(10, 1, 'District Governor', '<p class=\"digi-p\"><img src=\"image/harjit_singh.png\" class=\"img-responsive page-img\"></p>\r\n<p>DG - Harjit Singh 2019-20</p>\r\n<p>As is the norm worldwide, midnight 30th\r\nJune, the guard changes ‚Äì at all levels in\r\nRotary. My congratulations to all who have\r\na new role assigned in the SMART year ‚Äì be\r\nit President, Secretary, member of the club\r\nBOD, Chairman of a committee or any\r\nDistrict Assignment.</p>\r\n<p>Friends, we belong to a Premier district ‚Äì\r\n3141 which has a pride of place right on top\r\nin the Rotary World - be it membership, TRF\r\ncontributions or service projects. People\r\nlook up to us in awe and respect.</p> 		\r\n<p>It is a matter of great honour and pride\r\nthat we have 2 stalwarts from our district\r\nadorning important positions in Rotary\r\nInternational and The Rotary Foundation -\r\nPDG Dr Bharat Pandya as RI Director\r\n(2019-21) and PDG Gulam Vahanvaty as\r\nTRF Trustee (2018-22).</p>\r\n<p>Remember friends ‚Äì Our strength lies in\r\nTEAM WORK - let us together continue to\r\nspread SMILES in the community, through\r\nmeaningful projects and selfless service .</p>		\r\n<p>\r\nThe District Core team and I will be at your\r\nbeck and call, 24 x 7, for any help you may\r\nneed to realize your dreams for the SMART\r\nyear. Together let us resolve to make the\r\nSMART RY 2019-20 Exciting, Enriching, Eventful,\r\nEnjoyable and Rewarding for ALL.\r\n</p>	\r\n<p>My best wishes for a Glorious year ahead-\r\nthe best your club has ever seen - </p> 	\r\n<p>\"Dua hai ki Kaamyabi ke har shikhar pe\r\naap ka naam hoga,\r\nAapke har kadam par duniya ka salaam\r\nhoga,\r\nHimmat se mushkilon ka saamana karna,\r\nHamari dua hai ki waqt bhi ek din aapka\r\ngulam hoga.\"</p>		\r\n<p>\r\nYou are our true strength my friends -\r\nWe truly believe that we are because of YOU\r\n</p>	\r\n<p>JI HA DOSTO ‚Äì AAP HAIN, TO HUM HAIN !</p>		', 'District Governor', 'District Governor', 'District Governor                                                                                                                                                                                                                '),
(11, 1, 'District Governor Elect 2020-21', '<p class=\"digi-p\">\r\n	<img src=\"image/Sunnil Mehra.png\" class=\"img-responsive page-img\">\r\n</p>\r\n<p>Sunnil Mehra - DG Elect 2020-21</p>', 'District Governor Elect 2020-21', 'District Governor Elect 2020-21', 'District Governor Elect 2020-21        '),
(12, 1, 'District Governor Nominee', '<p class=\"digi-p\">\r\n								<img src=\"image/rajendra-agarwal.png\" class=\"img-responsive page-img\">\r\n								</p>\r\n																<p>Rajendra Agrawal - DG Nominee 2021-22</p>', 'District Governor Nominee', 'District Governor Nominee', 'District Governor Nominee'),
(13, 1, 'Past District Governors', '', 'Past District Governors', 'Past District Governors', 'Past District Governors'),
(14, 1, 'DG\'s Citation Criteria', '', 'DG\'s Citation Criteria', 'DG\'s Citation Criteria', 'DG\'s Citation Criteria'),
(15, 1, 'Inner Wheel Representative', '<p class=\"digi-p\">\r\n	<img src=\"image/devangi-vakharia.jpg\" class=\"img-responsive page-img\">\r\n</p>\r\n<p>Devangi Vakharia</p>\r\n<p>With her vision towards generating WELL BEING for all and a background of work in the same line, she comes across as lifelong learner with great zeal to learn and explore new avenues.</p>\r\n\r\n<p>Dr. Devangi an alumina of Nagpur University, completed her Masters in Human Development where she focused on Gifted Children and her insightful doctoral thesis was on Parental Expectations and Anxiety in Adolescents. Her immense experience with students and the parent population motivated her to work on their well being and healthy coping.</p>\r\n\r\n<p>With her academic and professional background, Dr. Devangi could have made a mark for herself in the corporate world where she was frequently offered eminent positions. But she chose to work hands-on in a sphere where she knows she can make a tangible difference, especially one which she herself can direct and guide in terms of its working.</p>\r\n\r\n<p>Her belief that it is the woman who creates society is the reason that she joined SNDT Women‚Äôs University where she enhanced the human growth cycle with her foresight and perseverance. Dr. Devangi has been working as a professor and practising counselling since 35 years as part of the visiting faculty at the SNDT Women‚Äôs University. Her major thrust areas in pursuing teaching encompasses counselling and curriculum planning for pre-school children. She has been the head of the PG Diploma in Early Childhood Education and also been counselling at the Nanavati College since the last 12 years. Ever since her association with the Nanavati College, she has been at the forefront of organizing and keenly following up the MMR vaccinations since past 15years.</p>\r\n\r\n<p>Her understanding that good and moralistic conduct takes root in young impressionable minds is why she works passionately with children. Her vision is all-encompassing and all-embracing but her heart reaches out most to the girl-child. Her aim is to empower girls and help them establish an independent identity with a feel-good self-image as well as a positive and dignified self-concept. She has mentored many students and has rendered a willing helping hand to them whenever they have felt the need. Thus, through structured planning, Dr. Devangi has done her best to ensure that her students will be model citizens in their respective careers and roles.</p>\r\n\r\n<p>A person who loves bonding with people,  and  an avid traveller her main focus lies in looking for the good in everyone and in everything, but with ethicality being uppermost for which she was awarded with Miss Goodness Queen in college. She not only looks for the good but also nurtures that in others.</p>\r\n\r\n<a href=\"http://innerwheeldistrict314.org/message/\" target=\"_blank\" class=\"read-btn\" data-original-title=\"\" title=\"\">Read More</a>', 'Inner Wheel Representative', 'Inner Wheel Representative', 'Inner Wheel Representative'),
(16, 1, 'Dist Rotaract Representative', '<p class=\"digi-p\">\r\n	<img src=\"image/kushal-bhuva.png\" class=\"img-responsive page-img\">\r\n</p>\r\n<p>DRR Rtr. Kushal Bhuva</p>\r\n<p>Rtr. Kushal Bhuva started his career in the K. C. College of Mumbai, where he graduated in Bachelors of Commerce with a clear vision of becoming an Entrepreneur one day.\r\nThis yound guy loved to experiment and wanted to be Soemone who can make a little difference in the society</p>		\r\n<p>He joint the Rotaract Club of KC College in 2010 as a hard-working member, trying to achieve the maximum for his organization and himself . His passion to Rotaract made him join a community based club The Rotaract Club of Bombay where he led the club as a President in 2012-13. He went on to become a part of the District team in 2015 as a member of the Partners-In-Service avenue for two consecutive years. During his tenure, he initiated some outstanding concepts and created a benchmark in the District.\r\nHe chaired The GOA RYLA for 5 years straight and fostering projects like Udaan ICON and the Interact Conference, he has led tremendous growth in the organisation. He formed the first Interact District in history of Rotaract Mumbai.</p>				\r\n<p>His love for training and development grew exponentially, He was then announced as the Sergeant- At-Arms and Chairman HRD for RID 3141 for the year 2017-18 . During this course, he initiated various training sessions and created the Helpdesk ‚Äì an automated response portal. His efforts have made the Rotaract presence felt in the public sector by creating Rotaract Postal Stamps.\r\nIn 2018-19 he was announced as the Chairman Zones & DRR Elect where he encouraged every zones to participate with their spirit & enthusiasm. He created a smooth functioning which encouraged the clubs participations and the Zonal Representative to work harder.</p>\r\n<a href=\"http://www.rotaract3141.org\" target=\"_blank\" class=\"read-btn\" data-original-title=\"\" title=\"\">Read More</a>\r\n							', 'Dist Rotaract Representative', 'Dist Rotaract Representative', 'Dist Rotaract Representative'),
(17, 1, 'Rotary Centers', '', 'Rotary Centers', 'Rotary Centers', 'Rotary Centers'),
(18, 1, 'RI President\'s Monthly Msg', '<p class=\"digi-p\">\r\n	<img src=\"image/maloney.jpg\" class=\"img-responsive page-img\">\r\n</p>\r\n<p>Mark Daniel Maloney</p>\r\n<p>President 2019-20</p>\r\n<p>I love to travel! I even enjoy the mundane process of getting from here to there. But last year, my wife, Gay, and I had one of those experiences that would strain the optimism of even the most cheerful traveler. We found ourselves with six hours to wait, at an airport where we were not scheduled to be, on a day we had not planned still to be traveling, having woken up that morning at a hotel unknown to us the night before. It was one of those days.</p>\r\n\r\n<p>As we waited at John F. Kennedy International Airport in New York City, Gay and I took a walk to people watch. We went from one end of the terminal to the other and back, looking at every gate, every destination, every group of people waiting for their flights.</p>\r\n\r\n<p>Each gate was its own island of humanity. When we walked down the center of the concourse, we were in New York, moving along with everyone in one river. But when you veered off into those seats, you left that current and landed on an island. You were already in Delhi or Paris or Tel Aviv.</p>\r\n\r\n<p>As we started our walk, I thought: \"All these different people, all these different countries, all in one place. This is like Rotary!\" But as we walked past gate after gate, I realized something. It was not like Rotary at all. Because everyone in that river was heading for an island. And every island stayed an island. The people heading to Taipei might be talking to one another, but they were not talking to the people heading to Cairo or Lagos.</p>\r\n\r\n<p>Contrast that with Rotary. Rotary allows us to connect with one another, in deep and meaningful ways, across our differences. It connects us with people we would never otherwise have met, who are more like us than we ever could have known. It connects us with our communities, to professional opportunities, and to the people who need our help.</p>\r\n\r\n<p>Connection is what makes the experience of Rotary so very different from walking along that concourse at JFK Airport. In Rotary, none of us is an island. All of us are in Rotary together, whoever we are, wherever we are from, whatever language we speak or traditions we follow. We are all connected to one another ‚Äî part of our communities and members not only of our clubs, but also of the global community to which we all belong.</p>\r\n\r\n<p>This connection is what lies at the heart of the Rotary experience. It is what brings us to Rotary. It is why we stay. Please join your fellow Rotarians on this journey as Rotary Connects the World.</p>\r\n<a href=\"https://www.rotary.org/en/about-rotary/our-leaders/directors\" target=\"_blank\" class=\"read-btn\" data-original-title=\"\" title=\"\">Read More</a>\r\n							', 'RI President\'s Monthly Msg', 'RI President\'s Monthly Msg', 'RI President\'s Monthly Msg'),
(19, 1, 'RI President Elect 2020-21', '<p class=\"digi-p\"> 	<img src=\"image/Holger_Knaack.jpg\" class=\"img-responsive page-img\"> </p> <p>RI President Elect 2020-21 - Holger Knaack</p> <p>Rotary Club of Herzogtum Lauenburg-M√∂lln Germany</p>		 <p>Knaack is the CEO of Knaack KG, a real estate company. He was previously a partner and general manager of Knaack Enterprises, a 125-year-old family business.</p>				 <p>He is a founding member of the Civic Foundation of the City of Ratzeburg and served as president of the Golf-Club Gut Grambek. Knaack is also the founder and chair of the Karl Adam Foundation.</p> <p>A Rotary member since 1992, Knaack has served Rotary as treasurer, director, moderator, member and chair of several committees, representative for the Council on Legislation, zone coordinator, training leader, and district governor.</p> <p>He is an endowment/major gifts adviser and was co-chair of the Host Organization Committee for the 2019 Rotary International Convention in Hamburg.</p> <a href=\"https://www.rotary.org/en/about-rotary/our-leaders/directors\" target=\"_blank\" class=\"read-btn\" data-original-title=\"\" title=\"\">Read More</a>', 'RI President Elect 2020-21', 'RI President Elect 2020-21', 'RI President Elect 2020-21                      '),
(20, 1, 'Rotary South Asia Office', '', 'Rotary South Asia Office', 'Rotary South Asia Office', 'Rotary South Asia Office'),
(21, 1, 'General Secretary', '<p>John Hewko has served as Rotary International‚Äôs general secretary since 2011. A charter member of the Rotary Club of Kyiv, Ukraine, Hewko lives out Rotary‚Äôs mission, whether inside or outside the office. He‚Äôs immunized children against polio in India, represented Rotary at the World Economic Forum, and bicycled 104 miles (167 km) with Rotary members in Arizona, USA, to help raise over $13 million for polio eradication. \"It‚Äôs an honor to go the extra mile in serving this great organization...........</p>\r\n								<div class=\"read-more-section\">\r\n									<a href=\"https://www.rotary.org/en/about-rotary/our-leaders\" target=\"_blank\" class=\"read-btn\" data-original-title=\"\" title=\"\">Read More</a>\r\n								</div>', 'General Secretary', 'General Secretary', 'General Secretary'),
(22, 1, 'Rotaract Clubs Of 3141', '<p>Join the global movement of young leaders who are developing innovative solutions to the world‚Äôs most pressing challenges.</p>\r\n\r\n<p>Rotaract clubs bring together people ages 18-30 to exchange ideas with leaders in the community, develop leadership and professional skills, and have fun through service.</p>\r\n\r\n<p>In communities worldwide, Rotary and Rotaract members work side by side to take action through service. From big cities to rural villages, Rotaract is changing communities like yours.</p>              <p>Know More&nbsp;<a href=\"https://www.rotary.org/en/get-involved/rotaract-clubs\" target=\"_blank\" data-original-title=\"\" title=\"\">https://www.rotary.org/en/get-involved/rotaract-clubs</a></p>\r\n              <a href=\"http://demo.thecreatiwitty.com/rotaract3141/new-to-rotaract/\" target=\"_blank\" class=\"read-btn\" data-original-title=\"\" title=\"\">Read More</a>\r\n  					', 'Rotaract Clubs Of 3141', 'Rotaract Clubs Of 3141', 'Rotaract Clubs Of 3141                                                    '),
(23, 1, 'Get Involved', '<p>Turn your passion for change into action through Rotary. Rotary members dream big and do whatever it takes to find solutions.</p>\r\n\r\n<p>Whether it‚Äôs as a member, partner, or supporter, you can be a part of the solution.</p>\r\n\r\n<p>Your time, energy, and a passion to improve your world are all you need to get involved with Rotary.</p>\r\n\r\n<p>Become a Rotary member or explore the many opportunities we have for anyone ‚Äî whatever your age or interest ‚Äî who wants to improve lives in communities near and far. Connect with a local Rotary club to find out how you can get involved.</p>              <a href=\"https://www.rotary.org/en/get-involved\" target=\"_blank\" class=\"read-btn\" data-original-title=\"\" title=\"\">Read More</a>\r\n  					', 'Get Involved', 'Get Involved', 'Get Involved'),
(24, 1, 'Interact Clubs Of 3141', '<p>Take action, build international understanding, and make new friends around the world.</p>\r\n\r\n<p>Interact clubs bring together young people ages 12-18 to develop leadership skills while discovering the power of Service Above Self. Find out how serious leadership can be seriously fun.</p>\r\n    						<p>Contact US &nbsp;&nbsp;<a href=\"mailto:drmanish@aasthahealthcare.com\" data-original-title=\"\" title=\"\">drmanish@aasthahealthcare.com</a></p>\r\n                            <a href=\"https://www.rotary.org/en/get-involved/interact-clubs#page-content\" target=\"_blank\" class=\"read-btn\" data-original-title=\"\" title=\"\">Read More</a>', 'Interact Clubs Of 3141', 'Interact Clubs Of 3141', 'Interact Clubs Of 3141'),
(25, 1, 'District Thrust Area', '<div class=\"col-md-4 col-sm-4 col-xs-4\">\r\n	<a href=\"template/view/dist/upload/dta-2019-20/district-thrust-areas-2019-20.pdf\" target=\"_blank\" class=\"box-ppt\">\r\n		<i class=\"fa fa-file-pdf-o point-icon\"></i>\r\n		<h3>District Thrust Areas</h3>\r\n	</a>\r\n</div>', 'District Thrust Area', 'District Thrust Area', 'District Thrust Area'),
(26, 1, 'Why Join Rotary', '<p>The heart of Rotary is our members, dedicated people who share a passion for community service and friendship.</p>\r\n\r\n<p>Rotary members share ideas, make plans, hear from the community, and catch up with friends during club programs that fuel the impact we make.</p>\r\n\r\n<p>Club benefits</p>\r\n\r\n<p>Your club connection gives you the chance to develop skills like public speaking, project management, and event planning. You‚Äôll meet interesting people from your community and around the world. And you‚Äôll tackle local and international issues that are important to you and your fellow club members.</p>  						<a href=\"https://www.rotary.org/en/get-involved/rotary-clubs\" target=\"_blank\" class=\"read-btn\" data-original-title=\"\" title=\"\">Read More</a>\r\n  					', 'Why Join Rotary', 'Why Join Rotary', 'Why Join Rotary'),
(27, 1, 'Join Rotary-Apply Now', '', 'Join Rotary-Apply Now', 'Join Rotary-Apply Now', 'Join Rotary-Apply Now'),
(28, 1, 'Rotary Seva Muhim', 'Under Construction', 'Rotary Seva Muhim', 'Rotary Seva Muhim', 'Rotary Seva Muhim'),
(29, 1, 'History of TRF', '<p>In 1917, RI President Arch C. Klumph proposed that an endownment be set up for the purpose of doing good in the world. In 1928, when the endownment fund had grown to more than US $5,000, it was renamed The Rotary Foundation and it became a district entity within Rotary International. Five Trustees, including Klumph, were appointed to hold, invest, manage and administer all of its property.as a single trust, for the furtherance of the purposes of RI. Two years later, the Foundation made its first grant of $500 to the International Society for crippled Children...........&nbsp;</p>\r\n\r\n							<a href=\"https://www.rotary.org/en/about-rotary/rotary-foundation\" target=\"_blank\" class=\"read-btn\" data-original-title=\"\" title=\"\">Read More</a>', 'History of TRF', 'History of TRF', 'History of TRF'),
(30, 1, 'TRF Trustee', '<p>The board of trustees manages the business of the Foundation, the charitable arm of our organization that funds service activities. The RI president-elect nominates the trustees, who are elected by the RI Board to four-year terms.</p>\r\n\r\n							<a href=\"https://www.rotary.org/en/about-rotary/our-leaders/trustees\" target=\"_blank\" class=\"read-btn\" data-original-title=\"\" title=\"\">Read More</a>', 'TRF Trustee', 'TRF Trustee', 'TRF Trustee'),
(31, 1, 'Donor Recognition', '<p>Your generous contributions to The Rotary Foundation are essential to securing and growing Rotary programs throughout the world. We recognize donors to express our gratitude for your commitment, offering individual and club recognition as well as naming opportunities that enable you to honor a friend or family member with a named or endowed gift.</p>\r\n\r\n							<a href=\"https://www.rotary.org/en/donate/recognition\" target=\"_blank\" class=\"read-btn\" data-original-title=\"\" title=\"\">Read More</a>', 'Donor Recognition', 'Donor Recognition', 'Donor Recognition'),
(32, 1, 'Powerpoint Presentations', '<div class=\"col-md-4 col-sm-4 col-xs-4\">\r\n	<a href=\"template/view/dist/upload/ppt-2019-20/Auditorium-1-RCC-Arun Choudhari.pptx\" class=\"box-ppt\">\r\n	<i class=\"fa fa-file-powerpoint-o point-icon\"></i>\r\n		<h3>Auditorium-1-RCC-Arun Choudhari</h3>\r\n	</a>\r\n</div>\r\n<div class=\"col-md-4 col-sm-4 col-xs-4\">\r\n	<a href=\"template/view/dist/upload/ppt-2019-20/Auditorium-2-PeopleofAction-PDGRahul.pptx\" class=\"box-ppt\">\r\n	<i class=\"fa fa-file-powerpoint-o point-icon\"></i>\r\n		<h3>Auditorium-2-PeopleofAction-PDGRahul</h3>\r\n	</a>\r\n</div>\r\n<div class=\"col-md-4 col-sm-4 col-xs-4\">\r\n	<a href=\"template/view/dist/upload/ppt-2019-20/Auditorium-3-CSR-PrakashS+PradeepS.pptx\" class=\"box-ppt\">\r\n	<i class=\"fa fa-file-powerpoint-o point-icon\"></i>\r\n		<h3>Auditorium-3-CSR-PrakashS+PradeepS</h3>\r\n	</a>\r\n</div>\r\n\r\n<a href=\"https://drive.google.com/drive/folders/1snJ36IHxotYmyn62T1ITIf_saVnKGpOj\" target=\"_blank\" class=\"read-btn\"> View Presentations</a>', 'Powerpoint Presentations', 'Powerpoint Presentations', 'Powerpoint Presentations'),
