(40, 1, 'Our Causes', '<p>Rotary is dedicated to six areas of focus to build international relationships, improve lives, and create a better world to support our peace efforts and end polio forever.</p>\r\n\r\n							<a href=\"https://www.rotary.org/en/our-causes\" target=\"_blank\" class=\"read-btn\" data-original-title=\"\" title=\"\">Read More</a>', 'Our Causes', 'Our Causes', 'Our Causes                                                    ');
